        <Route path="/Login" element={<LoginForm/>}/>
      </Routes>
*/
function App() {
  
  const methods = useForm({ mode: "onBlur" });
  const { watch, errors } = methods;

  useEffect(() => {
    console.log("FORM CONTEXT", watch(), errors);
  }, [watch, errors]);
  return (
    
    <div className="App">
      <header className="App-header">
      <FormProvider {...methods}>
        <FormStepper />
      </FormProvider>

      </header>
    </div>
  );
}




export default App;
